def maxFrequency( nums, k) -> int:
        nums.sort()
        n = len(nums)
        if nums[0] == nums[-1]:
            return n
        rev_nums = nums[::-1]
        frequency = {}
        max_frequency = 0
        for i,curr_num in enumerate(rev_nums):
            if curr_num in frequency: continue
            if n-i <= max_frequency : break
            frequency[curr_num] = 1
            curr_k = k
            for num in rev_nums[i+1:]:
                if num == curr_num:
                    frequency[curr_num] += 1
                    continue
                diff = curr_num - num
                if diff <= curr_k :
                    frequency[curr_num] += 1
                    curr_k -= diff
                else : break
            max_frequency = max(max_frequency,frequency[curr_num])
        return max_frequency
